import React, { Component } from 'react';
import { useNavigate } from "react-router-dom";
import './home/home.css'

const Home = (props) => {
  const navigate = useNavigate();
 
  return (
    <>
      <div className=''>
        <a href="https://ellipsis.co.tz/"><img className='picture' src="./images/Ellipsis logo.png" alt="logo"/></a>
      </div>

      <div className='content'>
        <strong className='software'>We BUILD SOFTWARE that</strong><br /> <strong className='work'>works.</strong><br /> 
        <p></p>Make an impact on your business, startup or organzation with us, start with a <strong>14 days FREE TRIAL</strong> & zero commitment.
      </div>

      <div className='b2'>
        <button className='bn' onClick={() => navigate("/")}>Join Our Team</button>
        <button className='bn0' onClick={() => navigate("/")}>Book an Appointment</button>
      </div>
    
    </>
   
  );
};
 
export default Home;
